import React from "react";

const projext_width = {
    color : "aliceblue", 
    // marginLeft: "10px" ,
    marginRight : "10px",

    backgroundColor: "rgba(22, 27, 190, 0.136)",
    
    borderRadius: "10px",
    maxWidth: "300px",
    boxShadow: "0 4px 8px 0 rgba(0 , 0 , 0 , 0.2)"
}

const Project_sub = () => {

    return (
        <>
            <div class="card" style={projext_width}>
                <img src="image.jpg" class="card-img-top" alt="Image Alt Text" />
                <div class="card-body">
                    <h5 class="card-title">Card Heading</h5>
                    <p class="card-text">Card content goes here...</p>
                </div>
            </div>
        </>
    )
}


export default Project_sub
